fields.descE:
ບົດລາຍງານສິນເຊື່ອຄົບຖ້ວນສຳລັບບຸກຄົນ ແມ່ນສະແດງໃຫ້ເຫັນເຖິງປະຫັວດການກູ້ຢືມນຳບັນດາທະນາຄານ ແລະ ສະຖາບັນການເງິນທີ່ເປັນສະມາຊິກ ຂອງ ບໍລິສັດ ຂສລ ເຊິ່ງສາມາດຮູ້ໄດ້: 
1. ສະແດງໃຫ້ເຫັນປະຫັວດການຊອກແຫຼ່ງທືນຂອງລູກຄ້າໃນແຕ່ລະໄລຍະ;                                                
2. ສະແດງໃຫ້ເຫັນຂໍ້ມູນທົ່ວໄປຂອງລູກຄ້າ;
3. ສະແດງໃຫ້ເຫັນປະຫັວນການຊຳລະສະສາງໃນແຕ່ລະໄລຍະຂອງລູກຄ້ານຳບັນດາທະນາຄານທຸລະກິດ ແລະ ສະຖາບັນການເງິນແຕ່ລະແຫ່ງ, ນອກນີ້ຍັງສາມາດເຫັນໄດ້ຍອດເຫຼືອໜີ້ແຕ່ລະບ້ວງ, ມື້ຄ້າງຊຳລະ,ການຈັດຊັ້ນໜີ້ ແລະ ສະຖານະພາບ;
4. ສະແດງໃຫ້ເຫັນຫຼັກຊັບຄ້ຳປະກັນໃນແຕ່ລະບ້ວງຂອງສັນຍາກູ້ຢືມ;

