fields.descE:
ຄ່າທຳນຽມສຳລັບບຸກຄົນ ​ແລະ ນິຕິບຸກຄົນ ທີ່​ບໍ່​ແມ່ນ​ສະມາຊິກ ມີ 2 ປະ​ເພດ​ຄື:
1. ​ເຈົ້າ​ຂອງ​ຂໍ້​ມູນ​ມາ​ຂໍ​ຂໍ້​ມູນ​ດ້ວຍ​ຕົນ​ເອງ;
2.ມອບ​ສິດ​ໃຫ້​ຜູ້​ອື່ນ​ມາ​ຂໍ​ຂໍ້​ມູນ​ແທນ.

